import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { BrowserRouter as Router } from 'react-router-dom';
import { EnergyProvider } from './context/EnergyContext';

ReactDOM.render(
  <Router>
    <EnergyProvider>
      <App />
    </EnergyProvider>
  </Router>,
  document.getElementById('root')
);
